scripts.blaster_init:
var vectorPool = ROYGBIV.createVectorPool(20);
var psPool = ROYGBIV.getParticleSystemPool("laserPool");
var explosionPool = ROYGBIV.getParticleSystemPool("explosionPool");

var pointerLocked = ROYGBIV.isMobile();

var psStartConfigs = new Object();
var explosionStartConfigs = new Object();

var NORM_VECT = ROYGBIV.vector(0, 0, 1);

ROYGBIV.globals.box1 = ROYGBIV.getObject("box1");
ROYGBIV.globals.box2 = ROYGBIV.getObject("box2");
ROYGBIV.globals.box3 = ROYGBIV.getObject("box3");
ROYGBIV.globals.vectorPool = vectorPool;
ROYGBIV.globals.light1 = ROYGBIV.getDynamicLight("light1");

var gun = ROYGBIV.getObject("gun");
var stopGunAnimationOnFinish = false;
var animFinished = false;

function handleLaser(x, y, z){
  var laser = ROYGBIV.getParticleSystemFromPool(psPool);
  if (!laser){
    return;
  }

  var startConf = psStartConfigs[laser.name];

  ROYGBIV.getEndPoint(gun, '+y', startConf.startPosition);


  var v1 = ROYGBIV.getFromVectorPool(vectorPool);
  var sp = startConf.startPosition;
  ROYGBIV.setVector(v1, x - sp.x, y - sp.y, z - sp.z);
  ROYGBIV.computeQuaternionFromVectors(NORM_VECT, v1, startConf.startQuaternion);

  ROYGBIV.multiplyScalar(v1, 1300, startConf.startVelocity);

  ROYGBIV.startParticleSystem(startConf);
}

var fpsControl = ROYGBIV.createFPSControl({
  playerBodyObject: ROYGBIV.getObject("playerBody"),
  initialPosition: ROYGBIV.vector(0, 200, 0),
  speed: 400,
  crosshairName: "ch1",
  weaponObject1: gun,
  requestFullScreen: false,
  crosshairExpandSize: 8,
  shootableObjects: [ROYGBIV.getObject("box1"), ROYGBIV.getObject("box2"), ROYGBIV.getObject("box3")],
  onShoot: function(x, y, z, objName){
    var animState = ROYGBIV.getAnimationState(gun, "anim1");
    if (animState == ANIMATION_STATE_NOT_RUNNING){
      ROYGBIV.startAnimation(gun, "anim1");
      stopGunAnimationOnFinish = false;
      handleLaser(x, y, z);
    }else if (animFinished){
      handleLaser(x, y, z);
      animFinished = false;
    }
  },
  onStoppedShooting: function(){
    stopGunAnimationOnFinish = true;
  }
});


ROYGBIV.stopScript("blaster_init");


if (!ROYGBIV.isMobile()){
  onScene1Entry();
}else{
  ROYGBIV.setScreenOrientationChangeListener(function(isOrientationLandscape){
    if (isOrientationLandscape){
      ROYGBIV.changeScene("scene1", onScene1Entry);
    }else{
      ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
    }
  });
  if (!ROYGBIV.isOrientationLandscape()){
    ROYGBIV.changeScene("rotateDevice", onSceneRotateDeviceEntry);
  }else{
    onScene1Entry();
  }
}

function onSceneRotateDeviceEntry(){
  ROYGBIV.startAnimation(ROYGBIV.getText("rotateDevice"), "anim1");
}

function onControlsMobileEntry(){
  var separator = ROYGBIV.getText("separator");
  var moveMobile = ROYGBIV.getText("moveMobile");
  var lookMobile = ROYGBIV.getText("lookMobile");
  var jumpMobile = ROYGBIV.getText("jumpMobile");
  var backMobile = ROYGBIV.getText("backMobile")

  ROYGBIV.setTextAlpha(moveMobile, 0);
  ROYGBIV.setTextAlpha(lookMobile, 0);
  ROYGBIV.setTextAlpha(jumpMobile, 0);
  ROYGBIV.setTextAlpha(backMobile, 0);

  ROYGBIV.onTextClick(backMobile, function(){
    ROYGBIV.changeScene("scene1", onScene1Entry);
  });

  ROYGBIV.startAnimation(separator, "anim1");
  ROYGBIV.onAnimationFinished(separator, "anim1", function(){
    ROYGBIV.startAnimation(moveMobile, "anim1");
    ROYGBIV.onAnimationFinished(moveMobile, "anim1", function(){
      ROYGBIV.setTextAlpha(moveMobile, 1);
      ROYGBIV.startAnimation(lookMobile, "anim1");
      ROYGBIV.onAnimationFinished(lookMobile, "anim1", function(){
        ROYGBIV.setTextAlpha(lookMobile, 1);
        ROYGBIV.startAnimation(jumpMobile, "anim1");
        ROYGBIV.onAnimationFinished(jumpMobile, "anim1", function(){
          ROYGBIV.setTextAlpha(jumpMobile, 1);
          ROYGBIV.startAnimation(backMobile, "anim1");
          ROYGBIV.onAnimationFinished(backMobile, "anim1", function(){
            ROYGBIV.setTextAlpha(backMobile, 1);
          });
        });
      });
    });
  });
}

function onControlsDesktopEntry(){
  var goBackContainer = ROYGBIV.getContainer("container9");
  var goBackText = ROYGBIV.getText("goBackDesktop");
  ROYGBIV.setTextColor(goBackText, "#ebdbb2");
  ROYGBIV.onContainerMouseOver(goBackContainer, function(){
    ROYGBIV.setTextColor(goBackText, "#fb4934");
  });
  ROYGBIV.onContainerMouseOut(goBackContainer, function(){
    ROYGBIV.setTextColor(goBackText, "#ebdbb2");
  });
  ROYGBIV.onContainerClick(goBackContainer, function(){
    ROYGBIV.changeScene("scene1", onScene1Entry);
  });
}

function onScene1Entry(){

  pointerLocked = ROYGBIV.isMobile();
  if (ROYGBIV.isMobile()){
    ROYGBIV.hideText(ROYGBIV.getText("clickToStart"));
  }else{
    ROYGBIV.startAnimation(ROYGBIV.getText("clickToStart"), "anim1");
    ROYGBIV.setScreenPointerLockChangeListener(function(isPointerLocked){
      if (ROYGBIV.getActiveSceneName() != "scene1"){
        return;
      }
      pointerLocked = isPointerLocked;
      if (isPointerLocked){
        ROYGBIV.hideText(ROYGBIV.getText("clickToStart"));
      }else{
        ROYGBIV.showText(ROYGBIV.getText("clickToStart"));
      }
    });
  }

  var githubText = ROYGBIV.getText("github");
  var controlsText = ROYGBIV.getText("controls");
  var lastgithubTime = 0;
  ROYGBIV.setTextColor(githubText, "#83a598");
  ROYGBIV.setTextColor(controlsText, "#83a598");
  ROYGBIV.onTextMouseOver(githubText, function(){
    ROYGBIV.setTextColor(githubText, "#fb4934");
  });
  ROYGBIV.onTextMouseOut(githubText, function(){
    ROYGBIV.setTextColor(githubText, "#83a598");
  });
  ROYGBIV.onTextClick(githubText, function(){
    if (performance.now() - lastgithubTime <= 500){
      return;
    }
    lastgithubTime = performance.now();
    window.open("https://github.com/oguzeroglu/ROYGBIV", "_blank");
  });
  ROYGBIV.onTextMouseOver(controlsText, function(){
    ROYGBIV.setTextColor(controlsText, "#fb4934");
  });
  ROYGBIV.onTextMouseOut(controlsText, function(){
    ROYGBIV.setTextColor(controlsText, "#83a598");
  });
  ROYGBIV.onTextClick(controlsText, function(){
    if (ROYGBIV.isMobile()){
      ROYGBIV.changeScene("controlsMobile", onControlsMobileEntry);
    }else{
      ROYGBIV.changeScene("controlsDesktop", onControlsDesktopEntry);
    }
  });

  ROYGBIV.executeForEachParticleSystem(explosionPool, function(ps) {
    explosionStartConfigs[ps.name] = {
      particleSystem: ps,
      startPosition: ROYGBIV.vector(),
      startQuaternion: ROYGBIV.quaternion()
    };
  });

  ROYGBIV.executeForEachParticleSystem(psPool, function(ps) {
    psStartConfigs[ps.name] = {
      particleSystem: ps,
      startPosition: ROYGBIV.vector(),
      startVelocity: ROYGBIV.vector(),
      startQuaternion: ROYGBIV.quaternion(),
      maxCameraDistance: 15
    };

    ROYGBIV.setCollisionListener(ps, function(collisionInfo){
      if (!collisionInfo.targetObjectName){
        return;
      }

      var v1 = ROYGBIV.getFromVectorPool(vectorPool);
      ROYGBIV.getParticleSystemVelocityAtTime(this, collisionInfo.particleSystemTime, v1);
      ROYGBIV.stopParticleSystem(this, 0);
      if (collisionInfo.targetObjectName.startsWith("box")){
        var box = ROYGBIV.getObject(collisionInfo.targetObjectName);
        var v2 = ROYGBIV.getFromVectorPool(vectorPool);
        ROYGBIV.multiplyScalar(v1, 30, v1);
        ROYGBIV.setVector(v2, collisionInfo.x, collisionInfo.y, collisionInfo.z);
        ROYGBIV.applyForce(box, v1, v2);
      }

      var explosionPS = ROYGBIV.getParticleSystemFromPool(explosionPool);
      if (!explosionPS){
        return;
      }

      var startConf = explosionStartConfigs[explosionPS.name];
      ROYGBIV.setVector(startConf.startPosition, collisionInfo.x, collisionInfo.y, collisionInfo.z);
      var fn = ROYGBIV.getFromVectorPool(vectorPool);
      ROYGBIV.setVector(fn, -collisionInfo.faceNormalX, -collisionInfo.faceNormalY, -collisionInfo.faceNormalZ);
      ROYGBIV.computeQuaternionFromVectors(v1, fn, startConf.startQuaternion);
      ROYGBIV.startParticleSystem(startConf);
    });
  });

  ROYGBIV.hide(ROYGBIV.getObject("tmpSurface"), true);
  ROYGBIV.hide(ROYGBIV.getObject("tmpWalls"), true);

  ROYGBIV.onAnimationFinished(gun, "anim1", function(){
    if (stopGunAnimationOnFinish){
      ROYGBIV.stopAnimation(gun, "anim1");
      stopGunAnimationOnFinish = false;
    }
    animFinished = true;
  });

  ROYGBIV.setActiveControl(fpsControl);
}

ROYGBIV.startScript("blaster_loop");

scripts.blaster_loop:
if (ROYGBIV.getActiveSceneName() == "scene1"){
  var v1 = ROYGBIV.getFromVectorPool(ROYGBIV.globals.vectorPool);
  var v2 = ROYGBIV.getFromVectorPool(ROYGBIV.globals.vectorPool);
  var v3 = ROYGBIV.getFromVectorPool(ROYGBIV.globals.vectorPool);
  ROYGBIV.getPosition(ROYGBIV.globals.box1, v1);
  ROYGBIV.getPosition(ROYGBIV.globals.box2, v2);
  ROYGBIV.getPosition(ROYGBIV.globals.box3, v3);

  ROYGBIV.updateLightPosition(ROYGBIV.globals.light1, (v1.x + v2.x + v3.x) / 3, (v1.y + v2.y + v3.y + 150) / 3, (v1.z + v2.z + v3.z) / 3);
}
